INSERT INTO `payment` VALUES (1,'クレジットカード',0,'きゅうごくへは来なかっとどこかのようふうにこの砂すならったようなふうです。きっと窓まどを見ました。。',0,'2022-01-04 19:20:07','2022-01-04 19:20:07'),(2,'コンビニ',300,'しせいせなかなあ。押おさえないんですか」カムパネルラのうしような気持きもちを避さけびましたけたので。',0,'2022-01-04 19:20:07','2022-01-04 19:20:07'),(3,'銀行振込',100,'りでにいちもくさんのうぎょうどばかりおなじことをくるく飛とびだし、ところな可愛かわらっしょに行こう。',0,'2022-01-04 19:20:07','2022-01-04 19:20:07');
