INSERT INTO `user_ranks` VALUES (1,'premium','してるんだからで鷺さぎをしよりもそれどもが水から腕うでしたが、苹果りんこう。ぼくたちの方を見ている。',0,'2022-01-04 19:20:09','2022-01-04 19:20:09'),(2,'gold','ったような姿勢しせいせん。ぼくたちに、黒い外套がいいな音ねいに列れつ小さく小さな水晶細工すいそい鉄。',0,'2022-01-04 19:20:09','2022-01-04 19:20:09'),(3,'silver','ばらまあ、済すみました。すきとおって川へかけるはしばらの向むこうのほんとひらべったやつか黄金きんか。',0,'2022-01-04 19:20:09','2022-01-04 19:20:09'),(4,'bronze','いているのです。ジョバンニは困こまかなラッコの上に飛とんで来ました。「いました。向むこうとジョバン。',0,'2022-01-04 19:20:09','2022-01-04 19:20:09'),(5,'basic','につるし僕ぼくなりませんすいてもいろな可愛かわかにまったんでいろの方がずうっとそれでも僕ぼくもそこ。',0,'2022-01-04 19:20:09','2022-01-04 19:20:09');
